import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div>
      <div> Countdown to December 25, 2017 </div>
      <div>
        <div>14 days</div>
        <div>30 hours</div>
        <div>15 minutes</div>
        <div>20 seconds</div>
      </div>
    </div>
  );
}

export default App;
